HQ very rare Bananas tv show promo music video from an outstanding and rare 1980's tv show from Germany, broadcasted from 1981 to 1984, this is practically unknown in America, but this show has very well known artists of the 1980's. 

The rarity of this show is that, all the appearances of very well known guests are a whole new promo music video production that easly could be considered as never seen before videos or second versions of several classic 80's videos.

&quot;Rock This Town&quot; is a song by the Stray Cats from their UK debut album Stray Cats. Its first US Release was on the 1982 album Built for Speed. It peaked at #9 on the Billboard Hot 100 in 1982, becoming the first of the band's three top ten hits in the U.S. It had also previously reached this position on the UK Singles Chart in 1981.



